import React from 'react';
import Typical from 'react-typical';
import './home.scss';
import circles from './assets/Circles.svg';


function home() {
  return (
    <div className="home">
      <header className="home-header">
        <img src={circles} className="home-circles" alt="circles"/> 
          <Typical
          className="title"
          steps={[' Young.', 2000, ' Belgian.', 2000, ' Web-designer.', 2000, ' Freelancer.', 2000, ' Self-learner.', 2000]}
          loop={Infinity}
          wrapper="h1"
          />
        <h3>Lo√Øc Verhaeghe</h3>
      </header>
      <footer>
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1920 165">
        <g id="Calque_2" data-name="Calque 2">
          <g id="Calque_1-2" data-name="Calque 1">
            <path class="cls-1" d="M960,164.974,0,165v-.026C0,74.472,433.36,0,960,0s960,74.472,960,164.974Z"/>
          </g>
        </g>
      </svg>
        <button className="home-button">scroll</button>
      </footer>      
    </div>
    );
}

export default home;
